I might not wait until after Christmas now.  That&#39;s way to exciting.  Bruce
email with where to send my check..

k



  _____  

From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf Of
Frank Ratka
Sent: Thursday, December 13, 2007 7:06 AM
To: EVP-ITC@yahoogroups.com
Subject: Re: [EVP-ITC] I heard my name!!!!



Misty and I ran a test during our groups recording session last night. She
wrote a word on the wordpad of her computer and had me ask my spirit team
what she wrote. They not only guessed before I asked the question but they
repeated the answer afterwards by yelling it several times. Needless to say
the test was successful being that she is in Florida and I am in Texas.

Regards,

Frank R.

----- Original Message ----
From: Kristin Morris &lt;ckmorris95@...&gt;
To: EVP-ITC@yahoogroups.com
Sent: Thursday, December 13, 2007 6:02:28 AM
Subject: RE: [EVP-ITC] I heard my name!!!!

That is so freakin? exciting! I can?t wait till I get my RS..  

k



  _____  

From: EVP-ITC@yahoogroups .com [mailto: EVP-ITC@yahoogroups .com ] On Behalf
Of judy_in_hollywood
Sent: Thursday, December 13, 2007 2:11 AM
To: EVP-ITC@yahoogroups .com
Subject: [EVP-ITC] I heard my name!!!!



Hi Bruce & All, Yesterday I recorded with my RS Hack and asked if anyone
wanted to say something and even asked if John Lennon was there or Mike &
Lisa, well, I think Mike may have said, &quot;Judy!&quot; after I said their names,
which I heard in real time, then on the recorded tape = WoW! Now, I&#39;m sure
it&#39;s not radio station voices!!! =Judy= 8-D 





  _____  

Be a better friend, newshound, and know-it-all with Yahoo! Mobile. Try
&lt;http://us.rd.yahoo.com/evt=51733/*http:/mobile.yahoo.com/;_ylt=Ahu06i62sR8H
DtDypao8Wcj9tAcJ%20&gt;  it now.




